N = 1000
gaussian_quantiles = make_gaussian_quantiles(mean=None,
                        cov=0.1,
                        n_samples = N,
                        n_features = 2,
                        n_classes = 2,
                        shuffle = True,
                        random_state = None)
X, Y = gaussian_quantiles

X.shape

Y.shape

Y = Y[:, np.newaxis]

plt.scatter(X[:,0], X[:,1], c=Y[:,0], s=40, cmap=plt.cm.Spectral)

"""##Funciones de activacion"""

def sigmoid(x, derivate=False):
  if derivate:
    return (np.exp(-x))/((np.exp(-x)+1)**2)
  else: 
    return 1 / (1+np.exp(-x))


def relu(x, derivate=False):
  if derivate:
    x[x<=0] = 0
    x[x>0] = 1
    return x
  else:
    return np.maximum(0,x)

"""##Funcion de perdida"""

def mse(y, y_hat, derivate=False):
  if derivate:
    return (y_hat - y)
  else:
    return np.mean((y_hat - y)**2)

"""#Generacion de capas y pesos en mi red neuronal"""

"Tenemos los x1 o datos de entrada que estan en gaussian_quantiles y ahora vamos a elaborar aleatoriamente los pesos y biases"

"""![image.png](data:image/png;base64,)"""

"(np.random.rand(10,3)*2) -1 => podemos sacar numeros aleatorios entre 0 y uno negativos"
def initialize_parameters_deep(layers_dim):
  parameters = {}
  L = len(layers_dim)
  for l in range(0, L-1):
    parameters['W'+str(l+1)] = (np.random.rand(layers_dim[l], layers_dim[l+1])*2)-1
    parameters['b'+str(l+1)] = (np.random.rand(1, layers_dim[l+1])*2)-1
  return parameters

"Construimos la estrutura de nuestra red neuronal"
"Recibimos dos features como lo habiamos declatrado anteriormente"
"La siguiente capa que tenga 4 neuronas"
"Despues de esa capa 8 neuronas"
"Como es una clasificacion que desenvoque todo en una neurona"
layer_dims = [2, 4, 8, 1]

params = initialize_parameters_deep(layer_dims)

params

params['W1'].shape

X.shape

"hacemos el producto punto con numpy"
np.matmul(X,params['W1'])

"Tambien se puede hacer la misma operacion con arroba"
X@params['W1']

def train(x_data, lr, params, training = True):
  params['A0'] = x_data
  ##Programacion Forward hacia adelante 

  params ['Z1'] = np.matmul(params['A0'], params['W1']) + params['b1']
  params['A1'] = relu(params['Z1'])

  params ['Z2'] = np.matmul(params['A1'], params['W2']) + params['b2']
  params['A2'] = relu(params['Z2'])

  params ['Z3'] = np.matmul(params['A2'], params['W3']) + params['b3']
  params['A3'] = sigmoid(params['Z3'])

  output = params['A3']

  if training:
    ##Backpropagation => en la ultima capa se calcula la derivada de la funcion de perdida por la activacion

    params['dZ3'] = mse(Y, output, True) * sigmoid(params['A3'], True)
    params['dW3'] = np.matmul(params['A2'].T, params['dZ3'])

    params['dZ2'] = np.matmul(params['dZ3'], params['W3'].T) * relu(params['A2'], True)
    params['dW2'] = np.matmul(params['A1'].T, params['dZ2'])

    params['dZ1'] = np.matmul(params['dZ2'], params['W2'].T) * relu(params['A1'], True)
    params['dW1'] = np.matmul(params['A0'].T, params['dZ1'])

    ##Gradient descent

    #learning rate lr

    params['W3'] = params['W3'] - params['dW3'] * lr
    params['b3'] = params['b3'] - (np.mean(params['dW3'],axis=0, keepdims=True)) * lr

    params['W2'] = params['W2'] - params['dW2'] * lr
    params['b2'] = params['b2'] - (np.mean(params['dW2'],axis=0, keepdims=True)) * lr

    params['W1'] = params['W1'] - params['dW1'] * lr
    params['b1'] = params['b1'] - (np.mean(params['dW1'],axis=0, keepdims=True)) * lr
  return output

layer_dims = [2, 4, 8, 1]
params = initialize_parameters_deep(layer_dims)
errors = []
for _ in range(80000):
  output = train(X,0.00001, params)
  if _ % 25 == 0:
    print(mse(Y,output))
    errors.append(mse(Y,output))

plt.plot(errors)

data_test = (np.random.rand(1000,2)*2) - 1
y = train(data_test, 0.0001, params, training=False)

y = np.where(y >= 0.5, 1, 0)

plt.scatter(data_test[:,0], data_test[:,1], c=y[:,0], s=40, cmap=plt.cm.Spectral)